import './App.css';
import { Message } from './components/Message'

const message_prop = 'I m a prop';
const message_prop1 = 'Prop are very happy';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Message message={ message_prop} message2 = {message_prop1} />
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
